  motionTypeLabel: {
    fontSize: "1.5rem",
    fontWeight: "bold",
    textAlign: "center", // Center text inside the label
  },
};

const MotionTypeLabel = () => {
  return <div style={styles.motionTypeLabel}>Motion Type</div>;
};

export default MotionTypeLabel;
